export const FiberManualRecordSVGIcon = forwardRef<SVGSVGElement, SVGIconProps>(
  function FiberManualRecordSVGIcon(props, ref) {
    return (
      <SVGIcon {...props} ref={ref}>
        <circle cx="12" cy="12" r="8" />
